import React from 'react';

const Error = () => {
    return (
        <div>
            <ul>
                <li className="not-found">
                    <h3>404 error</h3>
                    <p>Your page could not be found. Please try again.</p>
                </li>
            </ul>
        </div>
    );
}

export default Error;
